import React from 'react';
import Rightbar from './components/Rightbar';
import Sidebar from './components/Sidebar';
import Feed from './components/Feed';
import { Box, Stack } from '@mui/system';

export const App = () => {
  return (
    <Box
      sx={{
        backgroundColor: 'red',
      }}
    >
      <Stack>

      <Sidebar />
      <Feed />
      <Rightbar />
      </Stack>
    </Box>
  );
};
export default App;
